import React from 'react'
import Profile from './Profile'
import Navbar from './Navbar/Navbar.js'
import { BrowserRouter } from 'react-router-dom'
import ReactDOM from "react-dom/client";



const ProfilePage = () => {
    
  return (
    <BrowserRouter>

    <div>
    <Navbar/>
        <Profile/>
    </div>
    </BrowserRouter>
  )
}

export default ProfilePage
